'''编码（初始化种群）'''

def generate_skilllevel_set(product_num):
    #global SKILL_LEVEL
    s = list(it.product(range(2), repeat=product_num))#生成全排列
    #print(s)
    #将其转化为数组
    SKILL_LEVEL=[[]for i in range(len(s)-1)]
    for i in range(1,len(s)):
        for j in s[i]:
            SKILL_LEVEL[i-1].append(j)
    return SKILL_LEVEL


def generate_workers_seru(n, N):
    result = []
    for i in range(n-1):
        x = random.randint(1, N-(n-i-1))
        result.append(x)
        N -= x
    result.append(N)
    return result

def initial_population(popsize,seru_num,worker_num):
    #global ORDER_LIST  # 声明全局变量 ORDER_LIST
    #global SKILL_LEVEL  # 声明全局变量 SKILL_LEVEL
    population = []
    pops_objective = []
    while len(population) < popsize:
        worker_configuration = []
        #工人分配
        # 先分配共享全能工，可以为0
        full_worker = random.randint(0,(worker_num - seru_num))
        #print("full_worker", full_worker)
        worker_configuration.append(full_worker)
        # 为单元分配人数，不可以为0
        workers_seru = generate_workers_seru(seru_num,(worker_num - full_worker))
        #print("workers_seru", workers_seru)
        worker_configuration.extend(workers_seru)
        #print("worker_configuration",worker_configuration)
        #生成单元的技能水平
        skill_seru = []
        for i in range(seru_num):
            skill_seru.append(random.randint(1,len(SKILL_LEVEL)-1))
        #生成个体
        pop = [worker_configuration,skill_seru]
        #print("pop", pop)
        #判断是否是可行解，保证种群中都是可行解
        if (is_feasible_solution(pop) is True):
            pop_objective=[compute_trainingcost(pop),average_servicelevel(pop)]
            #print('pop_objective',pop_objective)
            #判断种群中是否有相同目标值的个体，如果有则不添加
            if pop_objective not in pops_objective:
                population.append(pop)
                pops_objective.append(pop_objective)
            else:
                continue
    #print('population',population)
    #print('pops_objective',pops_objective)
    return population,pops_objective

def add_lists(lists):#输入一个列表，输出每列之和
    result = []
    list_len = len(lists[0])#产品类型数
    for i in range(list_len):#需要求和的列表
        sum = 0
        for lst in lists:
            sum += lst[i]
        result.append(sum)
    return result

#判断个体是否是可行解，即：技能水平是否涵盖了所有的产品类型        
def is_feasible_solution(pop):#判断是否是可行解，输入个体，输出是否是可行解
    sum_skill = seru_num_each_product(pop)
    #print('sum_skill',sum_skill)
    for i in range(len(sum_skill)):
        if sum_skill.count(0) == 0:
            return True
        else:
            return False 
     
#用于找出可以生产每种产品的单元
def seru_num_each_product(pop):
    #global SKILL_LEVEL  # 声明全局变量 SKILL_LEVEL
    skill_seru = pop[1]
    #print("skill_seru", skill_seru) 
    sum_skill = []
    skill = []
    for i in skill_seru:
        skill.append(SKILL_LEVEL[i-1])
    #print("skill", skill)
    for i in range(len(SKILL_LEVEL[0])):#遍历每种产品
        product_seru_sum = 0
        for j in skill:
            product_seru_sum += j[i]
        sum_skill.append(product_seru_sum)    
    #print('sum_skill',sum_skill)  
    return sum_skill


def seru_can_process_products(skill):#输入每个单元的技能水平，输出每个单元可以处理的产品类型
    #global SKILL_LEVEL  # 声明全局变量 SKILL_LEVEL
    seru_products = [[] for i in range(len(skill))]#记录每个单元能够生产的产品集
    for i in range(len(skill)):#遍历每个单元的技能水平
        for j in range(len(SKILL_LEVEL[0])):#遍历每种产品
            if SKILL_LEVEL[skill[i]-1][j] == 1:
                seru_products[i].append(j)
            else:
                continue
    #print("seru_products",seru_products)
    return seru_products


