#定义目标函数2：系统服务水平
def compute_servicelevel(pop,order):#注意，必须保证输入的个体是可行解,order是按照时间顺序排好序的订单列表
    #print('计算服务水平pop',pop)
    copy_order = copy.deepcopy(order)
    worker_assignment = pop[0]
    seru_worker = worker_assignment[1:]
    seru_skill = pop[1]
    #print('worker_assignment',worker_assignment)
    #print('seru_skill',seru_skill)
    #定义列表
    fullworker_finishtime = [0 for i in range(worker_assignment[0])]#记录分配的全能工信息[全能工索引，完工时间]
    order_to_seru = [[] for i in range(len(seru_skill))]#用于记录每个seru分配的订单
    finishtime_list=[[0] for i in range(len(seru_skill))]#初始化每个Seru的完成时间为0
    fullworker_seru = [[] for i in range(worker_assignment[0])]#记录可转移全能工先后分配的单元
    #每种产品的可选分配单元
    candidate_seru_set = find_candidate_serus(pop) #[[产品1的可选单元],[],[]]
    #print('candidate_seru_set',candidate_seru_set)
    orderiscomplete = [] #记录每个订单是否在目标时间内完成，是1，否0
    #订单到达，分配订单到Seru,分配全能工到seru
    while len(copy_order)>0:#订单是按照到达顺序排列的，因此按照订单顺序分配订单
        #print('##############到达订单',copy_order[0])
        #分解订单信息
        producttype = copy_order[0][0]
        batchsize = copy_order[0][1]
        arrivaltime = copy_order[0][2]
        #步骤1:找出订单可用的Seru，即具备该种产品生产能力且订单到达时空闲的Seru
        #具备该种产品生产能力的seru
        #print('producttype',producttype)
        candidate_seru = candidate_seru_set[producttype-1]  #[]可生产该订单的单元
        #print('candidate_seru',candidate_seru)
        #判断订单到达时，这些具备该种产品生产能力的seru是否空闲
        available_seru = []#订单到达时可用的Seru，即当前单元的最后一单完成时间小于等于当前订单的到达时间
        available_seru_skill = []#可用Seru对应的技能水平
        for j in candidate_seru:
            if finishtime_list[j][-1] <= arrivaltime:#seru可用
                available_seru.append(j)
                available_seru_skill.append(seru_skill[j])
            else:
                continue
        #print('available_seru',available_seru)
        #print('available_seru_skill',available_seru_skill)
        #情况1：到达时只有1个可用的空闲单元，则直接分配到该单元
        if len(available_seru) == 1:
            assignseru = available_seru[0]
            begintime = arrivaltime
            #print('只有一个可用的空闲单元',assignseru)
            #print('begintime',begintime)
        #情况2：到达时有多个可用的空闲单元，则分配到技能水平低的单元,即能处理的产品类型少的单元，保证其他单元可处理更多的产品类型       
        elif len(available_seru) > 1:
            #print('有多个可用的空闲单元')
            available_seru_can_process_products = seru_can_process_products(available_seru_skill)#输入技能水平，输出其可以处理的产品类型
            #print('可用的空闲单元能够处理的产品类型',available_seru_can_process_products)
            sum_available_seru_products = [len(sublist) for sublist in available_seru_can_process_products ]
            #print('可用的空闲单元能够处理的产品类型和',sum_available_seru_products)
            min_skill = min(sum_available_seru_products)
            min_index = sum_available_seru_products.index(min_skill)#返回索引
            assignseru = available_seru[min_index]#返回的是单元编号
            begintime = arrivaltime
            #print('分配的单元',assignseru)
            #print('begintime',begintime)
        #情况3：到达时没有可用的空闲单元，则分配到第一个空闲的符合条件的单元
        else:
            #print('没有空闲单元')
            candidate_seru_finishtime = []#[单元编号，最后一个订单结束时间]
            for j in candidate_seru:
                candidate_seru_finishtime.append([j,finishtime_list[j][-1]])
            #print('candidate_seru_finishtime',candidate_seru_finishtime)
            candidate_seru_finishtime.sort(key= lambda x: x[1])#按照单元结束时间排序，选择最先结束的单元
            assignseru = candidate_seru_finishtime[0][0]
            begintime = candidate_seru_finishtime[0][1]#开始时间等于上个订单的完成时间
            #print('begintime',begintime)
        #步骤2:计算准备时间，更新orderInseru
        #情况1：单元内尚未有订单
        if len(order_to_seru[assignseru]) == 0:
            setuptime = 0
            #print('单元内尚未有产品',setuptime)
        #情况2：单元内已经有订单    
        else: 
            if order_to_seru[assignseru][-1][0] == producttype:#判断与前一个订单产品类型是否相同
                setuptime = 0
                #print('与前一产品相同',setuptime)
            else:
                setuptime = setuptime_standard
                #print('与前一产品不同',setuptime)
        order_to_seru[assignseru].append(copy_order[0])   
        #print('order_to_seru',order_to_seru)
        #步骤3：分配全能工，先到达的订单先分配全能工，以最大量分配全能工，计算等待时间和订单完成时间。
        #情况1：单元人数未达到最大值，可分配全能工
        if seru_worker[assignseru] < worker_maxnum:#判断单元人数是否超过最大数量，单元人数小于最大数量，则可分配全能工
            available_fullworker=[]
            for w in range(len(fullworker_finishtime)):#遍历全能工完工时间列表,为0表示未分配的全能工
                if fullworker_finishtime[w]  <= begintime:
                    available_fullworker.append(w)
                else:
                    continue
            #确定分配全能工的数量，分配全能工
            fullworker_num = min(len(available_fullworker),(worker_maxnum-seru_worker[assignseru]))
            selectworker = available_fullworker[:fullworker_num]
            #print('selectworker',selectworker)
            for i in selectworker:
                fullworker_seru[i].append(assignseru)
            #print('fullworker_seru',fullworker_seru)    
        #情况2：单元人数达到最大值，不可分配全能工
        else:
            fullworker_num = 0
            selectworker = []
        #步骤4：计算订单完工时间
        workers = seru_worker[assignseru] + fullworker_num#计算单元内的总人数
        waitingtime = begintime - arrivaltime
        finishtime = compute_order_finishtime(batchsize,workers,arrivaltime,waitingtime,setuptime)
        #更新fullworker_finishtime
        if len(selectworker) > 0:
            for w in selectworker:#遍历被分配的全能工
                fullworker_finishtime[w] = finishtime
            #print('更新后的fullworker_finishtime',fullworker_finishtime) 
        #更新finishtime_list            
        finishtime_list[assignseru].append(finishtime)
        #print('finishtime_list',finishtime_list)
        #更新订单列表，已分配的订单移除
        copy_order.remove(copy_order[0])#将已经分配的订单移除
        #print('finishtime_list',finishtime_list) 
        #步骤4：计算订单是否在目标交货期内完成 
        if (finishtime-arrivaltime) <= target_time:
            orderiscomplete.append(1)
        else:
            orderiscomplete.append(0)
        #print('orderiscomplete',orderiscomplete)
    #步骤5：根据订单在目标交付时间内完成情况计算服务水平    
    servicelevel = sum(orderiscomplete)/len(orderiscomplete)
    #print('servicelevel',servicelevel)
    return servicelevel

