def nondominatesort(pops_objective): #输入种群目标值列表，输出非支配排序
    #定义列表
    dominatedindividual_num =[0 for i in range(len(pops_objective))]#记录每个个体被支配个体数量，初始化为0
    dominate_set=[[] for i in range(len(pops_objective))]#记录每个个体的支配个体集，初始化为空，存储的是下标
    frontnumber=[0 for i in range(len(pops_objective))]#记录个体所属第几层front,数字代表的层数
    frontset_index=[[]]#记录按pareto层排序的解集,记录的是个体下标
    #生成各个体的支配集和被支配个数，并找出第一层front
    for p in range(len(pops_objective)): 
        #print('#############pops_objective[p]',pops_objective[p])
        for q in range(len(pops_objective)):
            #print('pops_objective[q]',pops_objective[q])
            if (pops_objective[p][0] <= pops_objective[q][0] and pops_objective[p][1] > pops_objective[q][1]) or (pops_objective[p][0] < pops_objective[q][0] and pops_objective[p][1] >= pops_objective[q][1]): #p支配q
                dominate_set[p].append(q)
                #print('dominate_set',dominate_set)
            elif (pops_objective[q][0] <= pops_objective[p][0] and pops_objective[q][1] > pops_objective[p][1]) or (pops_objective[q][0] < pops_objective[p][0] and pops_objective[q][1] >= pops_objective[p][1]):#q支配p
                dominatedindividual_num[p] += 1
                #print('dominatedindividual_num',dominatedindividual_num)
        if (dominatedindividual_num[p] == 0):#不被任何个体支配
            frontnumber[p]=1 #个体p在第1层
            #print('frontnumber',frontnumber)
            frontset_index[0].append(p)
    t=1
    while(sum(dominatedindividual_num) != 0):#找到每个非支配曲面的个体
        #print('sum(dominatedindividual_num)',sum(dominatedindividual_num))
        #print('t',t)
        nextfrontset=[] #下一个pareto解集,记录的是下标
        for p in range(len(pops_objective)):
            if dominatedindividual_num[p] == 0 and frontnumber[p] == t:
                for q in dominate_set[p]:
                    dominatedindividual_num[q] -= 1
                    if dominatedindividual_num[q] == 0:
                        nextfrontset.append(q)
                        frontnumber[q] = t + 1
                    #print('nextfrontset',nextfrontset)
                    #print('frontnumber[i]',frontnumber[i])
            else:
                continue
        if len(nextfrontset) != 0:
            frontset_index.append(nextfrontset)#非支配曲面集 
            t = t+1
    #print('非支配排序',frontset_index)
    #print('frontnumber',frontnumber)
    return frontset_index,frontnumber

# 注意，用归一化的目标值进行非支配排序，两个目标都是最小化，[[个体编号，拥挤度],[]]
# 输出的是与front中个体顺序相同的列表
def front_crowding_distance(front,fitness_values):
    #定义列表
    num_objectives = len(fitness_values[0])
    values = []#[个体编号，TC，Seed]
    crowding_distances = [[0, 0.0] for i in front]#[个体编号，拥挤度]
    #print("初始化 crowding_distances", crowding_distances)
    #取出当前层中个体的目标值
    for i in front:#i为个体编号
        #print("i",i)
        values.append([i,fitness_values[i][0],fitness_values[i][1]])#初始化拥挤度为0
    #\print("初始化values",values)
    #计算拥挤距离
    for i in range(num_objectives):
        if i == 0:  # 第一个目标是最小化目标函数
            sorted_values = sorted(values, key=lambda x: x[i+1])
            #print('第一个目标升序排序sorted_values',sorted_values)
            #初始化列表
            for c in range(len(sorted_values)):
                crowding_distances[c][0] = sorted_values[c][0]
            #print("初始化crowding_distances",crowding_distances)
        else:  # 用归一化处理后的目标值，第二个目标也是最小化，按递增的顺序进行排序
            sorted_values = sorted(values, key=lambda x: x[i+1],reverse=True)#reverse=True
            #print('第二个目标降序排序sorted_values',sorted_values)
        crowding_distances[0][1] = crowding_distances[len(front)-1][1] = float('inf')
        #print("拥挤距离首尾赋值",crowding_distances)
        fitness_range = sorted_values[len(front)-1][i+1] - sorted_values[0][i+1]
        #print("fitness_range",fitness_range)
        if fitness_range == 0:
            continue
        for j in range(1, len(front)-1):
            crowding_distances[j][1] += (sorted_values[j+1][i+1] - sorted_values[j-1][i+1]) / fitness_range
    #print("最终crowding_distances",crowding_distances)
    return crowding_distances

#输入前沿层，目标值列表；输出整个种群的拥挤距离，[[[个体编号，个体编码，拥挤度],[]],[],]
def crowding_distance(frontset,objective):
    distance_list=[]
    #print('frontset',frontset)
    #print('objective',objective)
    for i in range(len(frontset)):#遍历每一个前沿层
        distance = front_crowding_distance(frontset[i],objective)
        distance_list.append(distance)
    #print('distance_list',distance_list)
    return distance_list  


#  锦标赛选择，输入的pop_distance是拥挤距离，和frontnumber的序号对应
def tournament_selection(frontnumber, pop_distance, tournament_size):
    """
    二元锦标赛选择
    :param population: 种群
    :param fronts: 种群的非支配排序集合
    :param distances: 种群个体与所有参考点的距离平均值集合
    :param tournament_size: 锦标赛规模
    :return: 选择出的个体索引
    """
    selected_indices = []
    for i in range(2):#选两个个体
        tournament_indices = random.sample(range(len(frontnumber)), tournament_size)
        #print('tournament_indices',tournament_indices)
        best_index = tournament_indices[0]
        for j in tournament_indices[1:]:
            if frontnumber[j] < frontnumber[best_index]:
                best_index = j
            elif frontnumber[j] == frontnumber[best_index] and pop_distance[best_index][1] < pop_distance[j][1]:
                best_index = j
        selected_indices.append(best_index)
    #print('selected_indices',selected_indices)
    return selected_indices

#交叉算子，交叉技能水平部分，注意交叉后可能会成为不可行解
def crossover(pop1, pop2):
    copypop1 = copy.deepcopy(pop1)
    copypop2 = copy.deepcopy(pop2)
    seru_skill_one = copypop1[1]
    seru_skill_two = copypop2[1]
    #print('seru_skill_one',seru_skill_one)
    #print('seru_skill_two',seru_skill_two)
    # 随机选择两个交叉点
    index1 = np.random.randint(0, len(seru_skill_one) - 1)
    index2 = np.random.randint(index1, len(seru_skill_one))
    #print('index1',index1)
    #print('index2',index2)
    # 存储交叉点之间的代码
    code1 = seru_skill_one[index1:index2+1]
    code2 = seru_skill_two[index1:index2+1]
    # 交换两个交叉点之间的代码
    seru_skill_one[index1:index2+1] = code2
    seru_skill_two[index1:index2+1] = code1
    # 返回交叉后的两个个体
    newpops = []
    newpop_one = [copypop1[0]]
    newpop_two = [copypop2[0]]
    newpop_one.append(seru_skill_one)
    newpop_two.append(seru_skill_two)
    #print('newpop_one',newpop_one)
    #print('newpop_two',newpop_two)
    newpops.append(newpop_one)
    newpops.append(newpop_two)
    return newpops

#突变算子，对工人分配进行突变，任选两个单元或全能工池和单元，交换它们的工人分配
# 变异算子，对任意单元的技能水平进行突变
def mutation(pop):
    copypop = copy.deepcopy(pop)
    #print('copypop',copypop)
    skill_seru = copypop[1]
    index = [i for i in range(len(skill_seru))]
    #print('index',index)
    select_index = np.random.choice(index)
    #print('select_index',select_index)
    copypop[1][select_index] = random.randint(1,len(SKILL_LEVEL)-1)
    #print('copypop',copypop)
    return copypop

# 这里的distance是个体间的拥挤距离与NSGAII相似
# 通过 NSGA3 进化种群，产生子代
def get_offspring(population,frontnumber,crowd_distance): #输入父代，输出子代及子代目标值
    offspring = []
    offspring_objective = []
    #print('下一代函数中输入的crowd_distance',crowd_distance)
    # 将distances按照个体编号顺序排序
    pop_crowd_distance = [p for layer in crowd_distance for p in layer]
    #print('下一代函数中pop_crowd_distance',pop_crowd_distance)
    pop_crowd_distance.sort(key=lambda x: x[0])
    #print('排序后pop_crowd_distance',pop_crowd_distance)
    while len(offspring) < len(population):#产生子代
        #print('进入产生下一代的循环len(offspring)',len(offspring))
        # Step1：锦标赛选择，选择两个个体
        parent_index = tournament_selection(frontnumber,pop_crowd_distance, 2)
        #print('选择的个体编号', parent_index)
        parents = [population[i] for i in parent_index]
        #print('选择的个体parents',parents)
        # Step2：交叉
        newpops = [] #其中至少含有一个个体
        rc = random.random() #随机产生一个数
        #print('rc',rc)
        if ((rc <= cross_rate) and (parent_index[0] != parent_index[1])): #发生交叉，产生两个新个体
            #print("发生交叉")
            newpops = crossover(parents[0], parents[1])#cp中有两个个体
            #print("newpops",newpops)
        else: #没有发生交叉，任意选择一个个体按照概率发生变异
            #print("没有发生交叉")
            #随机选择一个个体，按照概率发生变异
            random_num = random.randint(0, 1)#从0和1中随机选择一个数
            #print('random_num',random_num)
            pop = parents[random_num]
            #print('pop',pop)
            #随机产生一个数，判断是否发生变异
            rm = random.random()
            #print('rm',rm)
            if (rm <= mutation_rate):#发生变异
                newpops.append(mutation(pop))
                #print("发生变异", newpops)
            else:#没有发生变异
                newpops.append(pop)
                #print("没有发生变异",newpops)
        #修复策略：判断是否是可行解，如果不是可行解需要修复
        repairedpops = []
        for i in newpops:#遍历遗传后的个体
            #print('变异后的个体i',i)
            if is_feasible_solution(i) is True:
                repairedpops.append(i)
                #print('变异后代是可行解添加')
            else:#不是可行解则修复后添加
                #print("不是可行解",i)
                repair_pop = repair(i)
                repairedpops.append(repair_pop)
        #print('repairedpops',repairedpops)
        #去重，子代中已经有的个体不添加,注意：是个体目标值是否相同，不是个体是否相同
        pop_objective=[]
        for i in repairedpops:
            pop_objective = [compute_trainingcost(i),average_servicelevel(i)]
            #print('pop_objective',pop_objective)
            if pop_objective not in offspring_objective:
                offspring.append(i)
                offspring_objective.append(pop_objective)
            else:
                continue
        #print('offspring',offspring)
        #print('offspring_objective',offspring_objective)
    offspring = offspring[:len(population)]
    offspring_objective = offspring_objective[:len(population)]
    #print('最终offspring',offspring)
    #print('最终offspring_objective',offspring_objective)
    return offspring,offspring_objective

#输入：父代种群、子代种群；输出：去重的合并种群，及其目标值
def combine_population(population1,objective1,population2,objective2):#输入父代种群和子代种群，输出新种群
    #初始化合并种群为父代种群
    con_pops = population1 
    con_objective = objective1
    #遍历子代种群的每个个体，将目标值不同的个体添加进合并种群
    for i in range(len(population2)):
        if  objective2[i] not in con_objective:
            con_pops.append(population2[i])
            con_objective.append(objective2[i])
    return con_pops,con_objective

#输入一个种群、目标值及非支配排序，输出新种群及其目标值（不是按照从小到大排序的）
def produce_new_parent_population(conpopulation,con_objective,frontset_index,popsize):#输入合并种群和种群规模，输出新父代种群
    #对合并种群的目标值列表进行深复制
    copy_objective=copy.deepcopy(con_objective)
    #定义列表
    newparents = []#新父种群
    newobjective = []#新父种群目标值列表
    number = 0 #记录front层
    while (len(newparents) < popsize):
        if ((len(newparents) + len(frontset_index[number])) <= popsize):
            #print("整层加入")
            for i in frontset_index[number]:#整层加入
                newparents.append(conpopulation[i])
                newobjective.append(copy_objective[i])
            number += 1
        else:
            #print("number",number)
            distance = front_crowding_distance(frontset_index[number],con_objective)#计算该层的拥挤距离
            #print('distance',distance)
            distance.sort(key= lambda x: x[1], reverse=True) #按照拥挤距离降序排序
            #print('拥挤距离降序排序distance',distance)
            parent_num = len(newparents)
            #print("加入该层部分个体")
            for i in range(popsize-parent_num):#新种群还差个体补齐
                newparents.append(conpopulation[distance[i][0]])
                newobjective.append(copy_objective[distance[i][0]])
            number += 1
    return newparents,newobjective
 
# 合并不同单元数下得到的非支配解
def merge_pareto_with_different_serus(all_pareto_pop,all_pareto_objective):
    merge_pareto_pop = all_pareto_pop[0]
    merge_pareto_objective = all_pareto_objective[0]
    for i in range(1,len(all_pareto_objective)):
        for j in range(len(all_pareto_objective[i])):
            if all_pareto_objective[i][j] not in merge_pareto_objective:
                merge_pareto_objective.append(all_pareto_objective[i][j])
                merge_pareto_pop.append(all_pareto_pop[i][j])
    return merge_pareto_pop,merge_pareto_objective
def get_sublist(lst, n, m):
    sublist = lst[:n]  # 取前 n 项
    sublist = [sub[:m] for sub in sublist]  # 对每个子列表取前 m 项
    return sublist
